import { Link } from 'react-router-dom'

const Home = () => {
    return (
        <>
            <section>
                <h1>Welcome to my MyBlog</h1>
                <Link to='/login'>Login</Link>
                <Link to='/signup'>Sign up</Link>
            </section>
        </>
    )
}

export default Home
